    "2016-03-17T07:01:46.848137",nt"name": "new-york-state-mathematics-exam",nt"isopen":
    false,nt"url": null,nt"notes": "NEW YORK CITY Results on the NEW YORK STATE
    English Language Arts (ELA) & Mathematics Examsrn(Grades 3 - 8)rn2013 - 2015rnNotes
    rnStarting in 2013, the NY State Education Department (NYSED) changed the exams
    to be Common Core aligned. Results on earlier exams from 2006-2012 can be found
    at this link: http://schools.nyc.gov/NR/exeres/05289E74-2D81-4CC0-81F6-E1143E28F4C4,frameless.htmrnResults
    presented here include all students who sat for either the Math or ELA exam. On
    the NYSED website, results for "matched" students can be found. To account for
    participation changes across years and anticipate the importance of year-to-year
    same-cohort comparisons for the Class of 2022, "matched" Math and ELA results
    were calculated to include 4th grade students who were tested in both the current
    and previous year and to include 5th u2013 8th grade students who were tested in
    all three years.rnIn order to comply with FERPA regulations on public reporting
    of education outcomes, rows with 5 or fewer students are suppressed.rnFor 2013,
    District 75 students are represented in their home districts and boroughs. For 2014
    & 2015, they are not included.rnCharter schools are not included. School level charter
    data can be found here: http://schools.nyc.gov/Accountability/data/TestResults/ELAandMathTestResultsrnIn
    2007, the New York State Education Department updated its testing policy for English
    Language Learners: ELLs in an English Language School System for more than one year
    are required to take the ELA exam. Previously, ELLs in an English Language School
    System for less than 3 years were exempt from taking the ELA exam. rnFormer English
    Language Learners includes any students who were classified as English Language
    Learners in at least one of the previous two school years. rnA change in State testing
    policy drove a decrease in eighth grade proficiency rates in 2014 and 2015: to reduce
    double testing, most students in accelerated math courses who took the Algebra Regents
    exam were exempt from taking the 7th and 8th grade State math assessment. The numbers
    on the "All - with Math Regents" tab represent  the equivalent proficiency had
    the accelerated math students in 7th and 8th grade taken the State math assessment.
    An "All Grades" row represents how this would impact a school's overall proficiency.
    Only Districts 1-32 are shown and rows with 5 or fewer students are suppressed.",nt"license_title":
